# 5927. Reverse Nodes in Even Length Groups
# User Accepted:1495
# User Tried:1968
# Total Accepted:1538
# Total Submissions:4055
# Difficulty:Medium
# You are given the head of a linked list.
#
# The nodes in the linked list are sequentially assigned to non-empty groups whose lengths form the sequence of the natural numbers (1, 2, 3, 4, ...). The length of a group is the number of nodes assigned to it. In other words,
#
# The 1st node is assigned to the first group.
# The 2nd and the 3rd nodes are assigned to the second group.
# The 4th, 5th, and 6th nodes are assigned to the third group, and so on.
# Note that the length of the last group may be less than or equal to 1 + the length of the second to last group.
#
# Reverse the nodes in each group with an even length, and return the head of the modified linked list.
#
#
#
# Example 1:
#
#
# Input: head = [5,2,6,3,9,1,7,3,8,4]
# Output: [5,6,2,3,9,1,4,8,3,7]
# Explanation:
# - The length of the first group is 1, which is odd, hence no reversal occurrs.
# - The length of the second group is 2, which is even, hence the nodes are reversed.
# - The length of the third group is 3, which is odd, hence no reversal occurrs.
# - The length of the last group is 4, which is even, hence the nodes are reversed.
# Example 2:
#
#
# Input: head = [1,1,0,6]
# Output: [1,0,1,6]
# Explanation:
# - The length of the first group is 1. No reversal occurrs.
# - The length of the second group is 2. The nodes are reversed.
# - The length of the last group is 1. No reversal occurrs.
# Example 3:
#
#
# Input: head = [2,1]
# Output: [2,1]
# Explanation:
# - The length of the first group is 1. No reversal occurrs.
# - The length of the last group is 1. No reversal occurrs.
# Example 4:
#
# Input: head = [8]
# Output: [8]
# Explanation: There is only one group whose length is 1. No reversal occurrs.
#
#
# Constraints:
#
# The number of nodes in the list is in the range [1, 105].
# 0 <= Node.val <= 105

# Definition for singly-linked list.

from typing import Optional
from linked_list import LinkedList, ListNode


def reverse(head: Optional[ListNode]) -> Optional[ListNode]:
    """Function to reverse linked list

    To reverse a linked list, 3 pointers: previous, current, next are necessary
    """
    prev, cur, nxt = None, head, head
    while cur:
        nxt = cur.next
        cur.next = prev
        prev = cur
        cur = nxt

    return prev


def partial_reverse(
    head: Optional[ListNode], start: int, length: int
) -> Optional[ListNode]:
    prev, current, next_node = None, head, head

    # move to the starting point of the reverse
    idx = 0
    while current and idx < start:
        prev = current
        current = current.next
        idx += 1

    # just reverse the the nodes until start + length
    prev, result_end = None, current
    while current and idx < start + length:
        next_node = current.next
        # core logic for reverse
        current.next = prev
        prev = current
        current = next_node
        idx += 1

    # connecting the rest of the nodes
    result_end.next = next_node

    # connecting to the starting nodes
    idx, runner = 0, head
    while runner and idx < start - 1:
        runner = runner.next
        idx += 1
    runner.next = prev

    return head


import collections
import unittest


class Solution:
    def reverseEvenLengthGroups(self, head: Optional[ListNode]) -> Optional[ListNode]:
        # scan the linked list to get the slices to reverse
        # put the slice into a queue
        # reverse until the queue becomes empty
        runner, length = head, 0
        while runner:
            runner = runner.next
            length += 1

        idx, group, queue = 0, 1, collections.deque()
        while idx < length:
            queue.append((idx, group))
            group += 1
            idx = idx + group - 1

        node = head
        while queue:
            start, length = queue.pop()
            if length % 2 == 0:
                node = partial_reverse(node, start, length)
        return node


